package com.databaseStorableItems;
import java.io.FileOutputStream;
import java.util.Base64;

public class Base64ToJPEG {
    public static void main(String[] args) {
        try {
            // Replace "your_base64_encoded_image_here" with the actual Base64 encoded image
            String base64Image = "";

            // Decode Base64 and convert to JPEG
            byte[] decodedImage = Base64.getDecoder().decode(base64Image);

            // Save or use the image as needed
            try (FileOutputStream fos = new FileOutputStream("C:\\Users\\zaina\\javaRevision\\src\\com\\databaseStorableItems\\output_image.jpg")) {
                fos.write(decodedImage);
            }
        } catch (Exception e) {
            e.printStackTrace();
        }
    }
}
